import { Button, Row } from "react-bootstrap";
import 'react-pdf/dist/esm/Page/AnnotationLayer.css';
import { Document, Page, pdfjs, PDFDownloadLink } from "react-pdf";
pdfjs.GlobalWorkerOptions.workerSrc = `//cdnjs.cloudflare.com/ajax/libs/pdf.js/${pdfjs.version}/pdf.worker.js`;

const options = {
    cMapUrl: 'cmaps/',
    cMapPacked: true,
    standardFontDataUrl: 'standard_fonts/',
  };

const MyDoc = () => (
    <Document file="AdamNelson_Resume2022.pdf" options={options}>
    <Page pageNumber={1}/>
    </Document>
  );

const Resume = () => {
    return (
        <div className="page d-flex flex-column justify-content-center align-items-center">
            <PDFDownloadLink document={<MyDoc />} fileName="AdamNelson_Resume2022.pdf">
                {({ blob, url, loading, error }) =>
                    loading ? 'Loading document...' : 'Download now!'
                }
            </PDFDownloadLink>

        </div>
    );
};

export default Resume;
